import '../App.css'
import FileGym from '../Layouts/FileGym';
import { NavBar } from '../Layouts/NavBar/NavBar';

export function Gym() {
    return ( 
        <div className='gym'>
            <div className='home_header'><NavBar/></div>
            <div className='gym-target'>
                <FileGym/>
            </div>
            
        </div>
    );
}
